import React, { useState, useEffect } from "react";
import axios from "axios"; // Import Axios

function YourComponent() {
  const [movies, setMovies] = useState([]); // Define the movies state

  const getMovies = async () => {
    try {
      const response = await axios.get(
        `https://api.themoviedb.org/3/discover/movie?api_key=42792e702bdfaa79e4dcffe831c6aa8b&language=en-US&limit=50`
      );
      console.log(response.data.results);
      setMovies(response.data.results);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    getMovies();
  }, []); // Make sure to pass an empty dependency array to useEffect

  // Rest of your component code here
}

export default YourComponent;
